import React, { useState, useEffect, useRef } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FaBars, FaTimes } from 'react-icons/fa'; // Ícones de menu e fechar
import styles from './Header.module.css';

const Header = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isCadastroOpen, setIsCadastroOpen] = useState(false);
  const [isLoginOpen, setIsLoginOpen] = useState(false);
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [isHamburgerOpen, setIsHamburgerOpen] = useState(false);
  const [activeIndex, setActiveIndex] = useState(-1);
  const searchRef = useRef(null);
  const resultRefs = useRef([]);
  const navigate = useNavigate();

  const fetchSearchResults = async (query) => {
    // Função para buscar resultados de pesquisa
    // Código de busca permanece o mesmo
  };

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery) fetchSearchResults(searchQuery);
  };

  const handleInputChange = (e) => {
    const query = e.target.value;
    setSearchQuery(query);
    setIsMenuOpen(!!query);
    if (query) {
      fetchSearchResults(query);
    } else {
      setSearchResults([]);
    }
  };

  const handleResultClick = (link) => {
    setIsMenuOpen(false);
    setSearchQuery('');
    navigate(link);
  };

  const handleHamburgerToggle = () => {
    setIsHamburgerOpen(!isHamburgerOpen);
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (searchRef.current && !searchRef.current.contains(event.target)) {
        setIsMenuOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  return (
    <header>
      <div className={styles.navbar}>
        <Link to="/" className={styles.brandL}>
          <span className={styles.brand}>JUSTIX</span>
        </Link>
        
        <div className={styles.searchContainer} ref={searchRef}>
          <form onSubmit={handleSearch} className={styles.searchForm}>
            <div className={styles.searchWrapper}>
              <input
                type="text"
                placeholder="Pesquisar..."
                value={searchQuery}
                onChange={handleInputChange}
                className={styles.searchInput}
              />
              <button type="submit" className={styles.searchButton}>Buscar</button>
            </div>
          </form>
          
          {isMenuOpen && searchResults.length > 0 && (
            <div className={styles.megaMenu}>
              <ul>
                {searchResults.map((result, index) => (
                  <li 
                    key={index} 
                    ref={(el) => (resultRefs.current[index] = el)} 
                    className={activeIndex === index ? styles.activeItem : ''}
                  >
                    <Link 
                      to={result.link}
                      onClick={() => handleResultClick(result.link)}
                    >
                      {result.name}
                    </Link>
                  </li>
                ))}
              </ul>
            </div>
          )}
        </div>

        <div className={styles.navleft}>
          <button onClick={() => setIsLoginOpen(true)} className={styles.navlinksl}>
            Login
          </button>
          <button onClick={() => setIsCadastroOpen(true)} className={styles.cadastrese}>
            Cadastre-se
          </button>
        </div>

        {/* Ícone de menu hambúrguer para mobile */}
        <div className={styles.menuHamburger} onClick={handleHamburgerToggle}>
          {isHamburgerOpen ? <FaTimes className={styles.hamburgerCloseIcon} /> : <FaBars className={styles.menuHamburgerIcon} />}
        </div>
      </div>

      {/* Conteúdo do menu hambúrguer */}
      {isHamburgerOpen && (
        <div className={`${styles.hamburgerMenuContent} ${isHamburgerOpen ? 'open' : ''}`}>
          <Link to="/" className={styles.hamburgerLink} onClick={handleHamburgerToggle}>Home</Link>
          <Link to="/login" className={styles.hamburgerLink} onClick={handleHamburgerToggle}>Login</Link>
          <Link to="/cadastro" className={styles.hamburgerLink} onClick={handleHamburgerToggle}>Cadastre-se</Link>
          <div className={styles.hamburgerLink} onClick={() => setIsDropdownOpen(!isDropdownOpen)}>Opções de busca</div>
          {isDropdownOpen && (
            <div>
              <Link to="/tribunais" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Tribunais</Link>
              <Link to="/foruns" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Fóruns</Link>
              <Link to="/juiz" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Juiz</Link>
              <Link to="/mediador" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Mediador</Link>
              <Link to="/advocacia" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Advocacia</Link>
              <Link to="/portais" onClick={handleHamburgerToggle} className={styles.hamburgerLink}>Portais</Link>
            </div>
          )}
        </div>
      )}
    </header>
  );
};

export default Header;
